import React, { useEffect, useRef } from 'react'
import * as echarts from 'echarts'
import { createEchartsOptions } from '../shared/create-echarts-options'
import { px } from '../shared/px'

export const Chart3 = () => {
  const divRef = useRef(null)
  useEffect(() => {
    var myChart = echarts.init(divRef.current)
    myChart.setOption(
      createEchartsOptions({
        legend: {
          bottom: px(10),
          textStyle: { color: 'white' },
          itemWidth: px(30),
          itemHeight: px(16),
        },
        grid: {
          x: px(20),
          x2: px(20),
          y: px(20),
          y2: px(70),
          containLabel: true,
        },
        xAxis: {
          type: 'category',
          boundaryGap: false,
          data: [2010, 2011, 2012, 2013, 2014, 2015, 2016, 2017, 2018],
          splitLine: { show: true, lineStyle: { color: '#073E78' } },
          axisTick: { show: false },
          axisLine: { show: false },
        },
        yAxis: {
          type: 'value',
          splitLine: { lineStyle: { color: '#073E78' } },
          axisLabel: {
            formatter(val) {
              return val * 100 + '%'
            },
          },
        },
        series: [
          {
            name: '抢劫',
            type: 'line',
            data: [
              0.04, 0.045, 0.04, 0.032, 0.027, 0.042, 0.03, 0.05, 0.053,
            ].reverse(),
          },
          {
            name: '醉驾',
            type: 'line',
            data: [
              0.035, 0.042, 0.036, 0.03, 0.025, 0.034, 0.026, 0.043, 0.041,
            ].reverse(),
          },
          {
            name: '盗窃',
            type: 'line',
            data: [
              0.03, 0.04, 0.03, 0.027, 0.02, 0.025, 0.017, 0.04, 0.037,
            ].reverse(),
          },
          {
            name: '故意杀人',
            type: 'line',
            data: [
              0.0, 0.01, 0.01, 0.02, 0.01, 0.02, 0.01, 0.02, 0.03,
            ].reverse(),
          },
          {
            name: '故意伤人',
            type: 'line',
            data: [
              0.02, 0.03, 0.02, 0.025, 0.017, 0.023, 0.011, 0.034, 0.035,
            ].reverse(),
          },
        ].map((obj) => ({
          ...obj,
          symbol: 'circle',
          symbolSize: px(12),
          lineStyle: { width: px(2) },
        })),
      }),
    )
  }, [])

  return (
    <div className="bordered 发案趋势">
      <h2>发案趋势分析</h2>
      <div ref={divRef} className="chart" />
    </div>
  )
}
